import React from 'react';
import { Card } from 'react-bootstrap';

function CurrentWeather(props) {
  const { weather } = props.weather;

  if (!props.weather) {
    return 'Loading...'
  }

  return (
    <Card>
        <Card.Body>
          {weather.icon}
          {weather.main}
          {weather.description}
        </Card.Body>
    </Card>
  );
}

export default CurrentWeather;
